<script>
	const util=require('../../untils/until.js')
	export default {
		data() {
			return {
				fattention: '', //放单敬告，
				conbook: '', //合同承诺书
				why_world: '', //为什么来一手下单，
				why_tle: "", //为什么来一手入住，
				spot_text: "", //驻场考情表，
				brand: "", //品牌战略
				content_info:''//

			}
		},
		methods: {
			getAttetion() {
				var that=this
				uni.request({
					url: "http://118.178.89.161:9999/attention/query",
					method: 'POST',
					header: {
						"Content-Type": "application/json"
					},
					data: {},
					success(res) {
						if (res.data.status == 200) {
							that.fattention = res.data.data[0].fAttention
							that.conbook = res.data.data[0].contractBook
							that.why_world = res.data.data[0].whyWorld
							that.why_tle = res.data.data[0].whyTlement
							that.spot_text = res.data.data[0].spotText
							that.brand = res.data.data[0].brand
							that.content_info=res.data.data[0]
						}else {
							uni.showToast({
								title:"加载出错",
								icon:'none'
							})
						}
					}
				})
			},
			openfile:util.throttle (function(url) { //打开pdf文件
				var str = ''
				if (url == 1) {
					str = this.fattention
				}
				if (url == 2) {
					str = this.conbook
				}
				if (url == 3) {
					str = this.why_world
				}
				if (url == 4) {
					str = this.why_tle
				}
				if (url == 5) {
					str = this.spot_text
				}
				if (url == 6) {
					str = this.brand
				}
				console.log(str)
			const downloadTask=	wx.downloadFile({
				  // 示例 url，并非真实存在
				  url:str, //下载的文件地址
				  success: function (res) {
					  console.log("下载")
					  uni.hideLoading()
					  uni.showToast({
					  	title:"下载完成"
					  })
				    const filePath = res.tempFilePath
				    wx.openDocument({
				      filePath: filePath,
				      success: function (res) {
				        console.log('打开文档成功')
				      }
				    })
				  }
				})
				downloadTask.onProgressUpdate((res) => {
					uni.showLoading({
						title: "下载中"+res.progress+"%"
					})
				  console.log('下载进度', res.progress)
				})
			},5000) 
		},
		onLoad() {
			this.getAttetion()
		}
	}
</script>
